                                var Qry1 = Query.Or(Query.Matches("Itemcode", BsonRegularExpression.Create(new Regex(str.TrimStart().TrimEnd(), RegexOptions.IgnoreCase))), Query.Matches("Materialcode", BsonRegularExpression.Create(new Regex(str.TrimStart().TrimEnd(), RegexOptions.IgnoreCase))));
