                                    //Start with
                                    var Qry1 = Query.Or(Query.Matches("Itemcode", BsonRegularExpression.Create(new Regex(string.Format("^{0}", str.TrimStart().TrimEnd()), RegexOptions.IgnoreCase))), Query.Matches("Materialcode", BsonRegularExpression.Create(new Regex(string.Format("^{0}", str.TrimStart().TrimEnd()), RegexOptions.IgnoreCase))));
                                    QryLst.Add(Qry1);
                                    
                                }
                                else
                                {
                                    //End with
                                    var Qry1 = Query.Or(Query.Matches("Itemcode", BsonRegularExpression.Create(new Regex(str.TrimStart().TrimEnd() + "$", RegexOptions.IgnoreCase))), Query.Matches("Materialcode", BsonRegularExpression.Create(new Regex(str.TrimStart().TrimEnd() + "$", RegexOptions.IgnoreCase))));
                                     QryLst.Add(Qry1);
                                   

                                }

                            }
                        }


                    }
                    var query = Query.And(QryLst);
                    query = Query.And(Query.GTE("ItemStatus", 1), query);
                    var arrResult = _DatamasterRepository.FindAll(fields, query).ToList();

                    return arrResult;
                }
                else
                {
                    var Qry1 = Query.Or(Query.Matches("Itemcode", BsonRegularExpression.Create(new Regex(term.TrimStart().TrimEnd(), RegexOptions.IgnoreCase))), Query.Matches("Materialcode", BsonRegularExpression.Create(new Regex(term.TrimStart().TrimEnd(), RegexOptions.IgnoreCase))));
                    
                    Qry1 = Query.And(Query.GTE("ItemStatus", 1), Qry1);
                    var arrResult = _DatamasterRepository.FindAll(fields, Qry1).ToList();
                   
                    return arrResult;
                  
                }

            }
