                                {
                                    if (-1 == arrResult.FindIndex(f => f.UniqueId.Equals(mdl.UniqueId)))
                                        arrResult.Add(mdl);

                                }
                                // }

                            }

                        }
                    }
                    //Noun Order check
                    var newreturnLst = new List<Prosol_AssetMaster>();
                    if(NounResult.Count > 0)
                    {
                        foreach (Prosol_AssetMaster mdl in NounResult)
                        {

                            if (-1 != arrResult.FindIndex(f => f.UniqueId.Equals(mdl.UniqueId)))
                                newreturnLst.Add(mdl);
                        }
                        foreach (Prosol_AssetMaster mdl in arrResult)
                        {

                            if (-1 == newreturnLst.FindIndex(f => f.UniqueId.Equals(mdl.UniqueId)))
                                newreturnLst.Add(mdl);
                        }
                        return newreturnLst;
                    }
                    else
                    {
                        return arrResult;
                    }

                 
                }
            }
            else
            {
                term = term.Replace(',', '*');
                term = term.Replace('(', '*');
                term = term.Replace(')', '*');
                //  term = term.Replace(' ', '*');
                // term = term.Replace('-', '*');
                if (term.Contains('*'))
                {


                    var QryLst = new List<IMongoQuery>();
                    var QryLst1 = new List<IMongoQuery>();
                    string[] sepArr = term.Split('*');
                    if (sepArr.Length > 2)
                    {
                        foreach (string str in sepArr)
                        {
                            if (str != "")
                            {
                                var Qry1 = Query.Or(Query.Matches("UniqueId", BsonRegularExpression.Create(new Regex(str.TrimStart().TrimEnd(), RegexOptions.IgnoreCase))), Query.Matches("AssetNo", BsonRegularExpression.Create(new Regex(str.TrimStart().TrimEnd(), RegexOptions.IgnoreCase))));
                                QryLst.Add(Qry1);
                               
                            }
                        }
                    }
                    else
                    {
                        foreach (string str in sepArr)
                        {
                            if (str != "")
                            {
                                if (term.IndexOf('*') > 0)
                                {
                                    //Start with
                                    var Qry1 = Query.Or(Query.Matches("UniqueId", BsonRegularExpression.Create(new Regex(string.Format("^{0}", str.TrimStart().TrimEnd()), RegexOptions.IgnoreCase))), Query.Matches("AssetNo", BsonRegularExpression.Create(new Regex(string.Format("^{0}", str.TrimStart().TrimEnd()), RegexOptions.IgnoreCase))));
                                    QryLst.Add(Qry1);
                                    
                                }
                                else
                                {
                                    //End with
                                    var Qry1 = Query.Or(Query.Matches("UniqueId", BsonRegularExpression.Create(new Regex(str.TrimStart().TrimEnd() + "$", RegexOptions.IgnoreCase))), Query.Matches("AssetNo", BsonRegularExpression.Create(new Regex(str.TrimStart().TrimEnd() + "$", RegexOptions.IgnoreCase))));
                                     QryLst.Add(Qry1);
                                   

                                }

                            }
                        }


                    }
                    var query = Query.And(QryLst);
                    query = Query.And(Query.GTE("ItemStatus", 1), query);
                    var arrResult = _AssetRepository.FindAll(fields, query).ToList();

                    return arrResult;
                }
                else
                {
                    var Qry1 = Query.Or(Query.Matches("UniqueId", BsonRegularExpression.Create(new Regex(term.TrimStart().TrimEnd(), RegexOptions.IgnoreCase))), Query.Matches("AssetNo", BsonRegularExpression.Create(new Regex(term.TrimStart().TrimEnd(), RegexOptions.IgnoreCase))));
                    
                    Qry1 = Query.And(Query.GTE("ItemStatus", 1), Qry1);
                    var arrResult = _AssetRepository.FindAll(fields, Qry1).ToList();
                   
                    return arrResult;
                  
                }

            }
